import React, { useState, useEffect } from "react";
import { Container, Row, Col } from "reactstrap";
import axios from "axios";
import "../styles/booking.css";
import ExportToExcel from '../compio/ExportToExcel'; 


const Bookingss = () => {
  const [bookings, setBookings] = useState([]);
  const [tours, setTours] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const bookingResponse = await axios.get(
        `http://localhost:4000/api/v1/booking/`
      );
      setBookings(bookingResponse.data.data);

      // Fetch tour data
      const tourResponse = await axios.get(
        `http://localhost:4000/api/v1/tours`
      );
      setTours(tourResponse.data.data);

      setLoading(false);
    } catch (error) {
      console.error("Error fetching data:", error);
      setLoading(false);
    }
  };

  const handleDelete = async (bookingId) => {
    try {
      // Send a DELETE request to your API to delete the booking
      await axios.delete(`http://localhost:4000/api/v1/booking/${bookingId}`);
      // Remove the deleted booking from the local state
      setBookings((prevBookings) =>
        prevBookings.filter((booking) => booking._id !== bookingId)
      );
    } catch (error) {
      console.error("Error deleting booking:", error);
    }
  };

  // Function to export bookings to Excel
  const exportToExcel = () => {
    const dataset = bookings.map((booking) => ({
      UserEmail: booking.userEmail,
      FullName: booking.fullName,
      GuestSize: booking.guestSize,
      Phone: booking.phone,
      BookAt: booking.bookAt,
      TourDetails: tours.find((tour) => tour.title === booking.tourName)?.city,
    }));

    const data = [
      {
        columns: [
          { title: "User Email", width: { wpx: 150 } },
          { title: "Full Name", width: { wpx: 150 } },
          { title: "Guest Size", width: { wpx: 100 } },
          { title: "Phone", width: { wpx: 100 } },
          { title: "BookAt", width: { wpx: 150 } },
          { title: "Tour Details", width: { wpx: 150 } },
        ],
        data: dataset,
      },
    ];

    return (
      <ExcelFile
        filename="bookings"
        element={
          <Button color="success" className="mt-3">
            Convert to Excel
          </Button>
        }
      >
        <ExcelSheet dataSet={data} name="bookings" />
      </ExcelFile>
    );
  };

  return (
    <section>
      <Container>
        <Row>
          <Col lg="12">
            <h4 className="fw-bold">Bookings</h4>
          </Col>
          <Col lg="12">
          <ExportToExcel data={bookings} filename="bookings" />
            
            <table className="table">
              <thead>
                <tr>
                  <th>User Email</th>
                  <th>Full Name</th>
                  <th>Guest Size</th>
                  <th>Phone</th>
                  <th>BookAt</th>
                  {/* Add this column for tour details */}
                  <th>Tour Details</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {loading ? (
                  <tr>
                    <td colSpan="7">Loading...</td>
                  </tr>
                ) : (
                  bookings.map((booking) => (
                    <tr key={booking._id}>
                      <td>{booking.userEmail}</td>
                      <td>{booking.fullName}</td>
                      <td>{booking.guestSize}</td>
                      <td>{booking.phone}</td>
                      <td>{booking.bookAt}</td>
                      <td>
                        {/* Display tour details based on booking data */}
                        {tours.find((tour) => tour.title === booking.tourName)?.city}
                      </td>
                      <td>
                        <button
                          onClick={() => handleDelete(booking._id)}
                          className="btn btn-danger"
                        >
                          Delete
                        </button>
                        {/* You can add more actions here */}
                      </td>
                    </tr>
                  ))
                )}
              </tbody>
            </table>
          </Col>
          <Col lg="12">{exportToExcel()}</Col>
        </Row>
      </Container>
    </section>
  );
};

export default Bookingss;
